class About extends React.Component {
  constructor(props) {
    super(props);
  }

render() {
  return(
    <p>
      I have a unique background which helps me to view software development through a creative lens. 
      I come from an upbrining immersed in visual arts, years spent learning and working in the culinary arts,
      and continued education in multiple areas with a focus towards Public Health and federal grant work.

      As a Full Stack Developer I can provide custom services depending upon your needs. Please contact me using
      the following form if you would like to discuss a potential project.
    </p>
  )};
}
export default About
